<template>
  <div class="container">
    <p class="explain">邀请好友扫二维码并成功注册,即可获得活跃值奖励, <br/>TA完成代销新手阶段任务,你可以获得相应的<span class="red">现金返利</span></p>
    <p class="rule">活动规则 ></p>
    <div class="qr">
      <canvas class="qr-canvas" canvas-id="qr-canvas"></canvas>
    </div>
    <button class="share">保存并分享图片</button>
  </div>
</template>
<script>
  import base64src from '../../common/js/base64src';
export default {
  onHide(){
  },
  onShow() {
    this.initCanvas();
  },
  components: {
  },
  data () {
    return {
    }
  },
  methods: {
    initCanvas(){
      wx.createSelectorQuery().select('.qr-canvas').boundingClientRect(res => {
        if(res){
          const scale = res.width/700;
          const ctx = wx.createCanvasContext('qr-canvas');
          //text
          ctx.setFontSize(24*scale);
          ctx.setTextAlign('center');
          ctx.setTextBaseline('top');
          ctx.fillText('长按识别二维码 ,XXXXXXXXXXXXXXXX', 700/2*scale, 695*scale);
          ctx.fillText('此二维码将于2019年1月1日更新', 700/2*scale, 730*scale);
          //logo
          base64src('data:image/png;base64,').then(res=>{
            ctx.drawImage(res,277*scale,27*scale,146*scale,81*scale);
          }).then(()=>{
            //qr
            base64src('data:image/jpeg;base64,').then(res=>{
              ctx.drawImage(res,95*scale,145*scale,510*scale,510*scale);
              ctx.draw();
            });
          });
        }
      }).exec();
    }
  },
}
</script>
